import React from 'react';
import './Navbar.css';
import Logo from '../Assets/istockphoto-579771988-612x612-removebg-preview.png'
const Navbar = () => {
    return (
        <div className='navbar'>
        <div className="nav-logo">
            <img src={Logo} alt="shope logo" />
            <p>Elite Market</p>
        </div>
        <div>
            ul
        </div>
        </div>
    )
}

export default Navbar
